import React from 'react'
import Item from './Item'

const Items = (props) => {
    onmousedown = (listId) => {
        props.selectItem(listId)
    }

    const { selectedItems } = props
    return (
        <React.Fragment>
            <Item key={1} listId={1} selectedItems={selectedItems} onmousedown={onmousedown}/>
            <Item key={2} listId={2} selectedItems={selectedItems} onmousedown={onmousedown}/>
            <Item key={3} listId={3} selectedItems={selectedItems} onmousedown={onmousedown}/>
        </React.Fragment>
    )
}

export default Items
